The 2nd Annual Expert Symposium was nothing short of memorable! I cannot even begin to express my gratitude towards the attendees, faculty, staff, & sponsors/support that made this possible! I had the honor of co-directing with @dr.rivkin for the second time, as well as phenomenal faculty that continuously help evolve this industry & providers within it. 
@drjonathansykes did an ineffably great job with anatomy dissection and showcasing the vasculature of the face. 
@pa_nicola covered a comprehensive approach to temple injection & technique for maximized safety & optimized patient results. 
@drkian did a fantastic job showing the anatomy of jawline injection with lower facial balancing, & did a special quick feature on threads!
& Dr. Yoelin doing a superb job for tear-trough injection, as well as complication intervention! 
@thestellacenter combining everything together with Anatomy of Ultrasound Guided Injection & also filler complication management utilizing ultrasound. 
& of course @act_aesthetictraining for being such a great instructor and always so willing to help anywhere/everywhere. 
@aestheticrecord @drtiphanyhall your expertise & creative capabilities behind the AV, added so much more to everyone’s experience! 

The attendees this year added so much diversity and value to this course. Thank you all for a great 2nd year, & I cannot wait for the next one 💉
